import React, { useEffect } from 'react';
import Home from './components/Home';
import Navbar from './components/Navbar';
import AOS from 'aos';

function App() {
  useEffect(() => {
    AOS.init({ duration: 800, easing: 'ease-in-out', once: true });
  }, []);

  return (
    <>
      <Navbar />
      <main className="container my-5">
        <Home />
      </main>
    </>
  );
}

export default App;
